import React, { useState } from "react";
import Styles from "./Homev2.module.css";
import QuotesGrid from "./QuotesGrid/QuotesGrid";
import { BrowserRouter, Route } from "react-router-dom";
import Avatar from "../Avatar/Avatar";
import NavList from "./NavList/NavList";
export default function Homev2() {
	const [test, setTest] = useState(1);

	return (
		<div className={Styles.Container}>
			<BrowserRouter>
				<div className={Styles.Items}>
					{/*The navbar renders for every route!*/}
					<Route path="/" component={NavList}></Route>
				</div>
				<div className={Styles.CenterColumn}>
					<Route path="/profile" exact component={Avatar}></Route>

					<Route path="/home" exact component={QuotesGrid}></Route>
				</div>
				<div className={Styles.Items}></div>
			</BrowserRouter>
		</div>
	);
}
